import HeroName from "./HeroName"
import PropTypes from "./PropTypes"
import Users from "./Users"
import Counter from "./Counter"

function App() {
  return (
    <>
      <Users />
      <Counter/>
      <HeroName />
      <PropTypes />
    </>
  )
}

export default App;
